осей\r\n•	замена батареек в руке\r\n•	внешний осмотр робота\r\n•	проверка наличия нехарактерных шумов\r\n•	проверка на наличие люфтов\r\n•	проверка срабатывания тормозов моторов\r\n•	проверка состояния кабелей\r\n•	натяжение ремня 6той оси\r\n\r\nЗамечания и контрмеры\r\n1.	Отработанная смазка осей JT2 имеет чёрный цвет и горелый запах, что говорит об интенсивной работе редуктора. \r\n	Действия не требуются. \r\n2.	Ремень 6той оси истерся и потерял требуемое натяжение.	\r\n        Ремень был натянут до требуемых параметров. Рекомендовано иметь запасной ремень на складе.\r\n\r\nИнженер Герасимов А.В.',49,0),(9,19,'2022-10-24 10:54:26.048939',NULL,'~',NULL,'2022-10-20','В соответствии с регламентом ТО 10000 произведены\r\n•	замена смазки редукторов всех осей\r\n•	замена батареек в руке\r\n•	внешний осмотр робота\r\n•	проверка наличия нехарактерных шумов\r\n•	проверка на наличие люфтов\r\n•	проверка срабатывания тормозов моторов\r\n•	проверка состояния кабелей\r\n•	натяжение ремня 6той оси\r\n\r\nЗамечания и контрмеры\r\n1.	Отработанная смазка осей JT2 имеет чёрный цвет и горелый запах, что говорит об интенсивной работе редуктора. \r\n	Действия не требуются. \r\n2.	Ремень 6той оси истерся и потерял требуемое натяжение.	\r\n        Ремень был натянут до требуемых параметров. Рекомендовано иметь запасной ремень на складе.\r\n\r\nИнженер Герасимов А.В.',49,0),(10,20,'2022-10-26 09:14:27.898011',NULL,'+',1,'2022-05-06','Обслуживание робота',52,0),(10,21,'2022-10-26 09:14:28.267449',NULL,'~',1,'2022-05-06','Обслуживание робота',52,0),(11,22,'2022-10-27 07:35:55.837489',NULL,'+',1,'2021-04-23','В соответствии с регламентом ТО 10000 произведены\r\n•	замена смазки редукторов всех осей\r\n•	замена батареек в руке и в контроллере робота\r\n•	внешний осмотр робота\r\n•	проверка наличия нехарактерных шумов\r\n•	проверка на наличие люфтов\r\n•	проверка срабатывания тормозов моторов\r\n•	проверка состояния кабелей',59,0),(11,23,'2022-10-27 07:35:55.996042',NULL,'~',1,'2021-04-23','В