74,'2023-08-14 08:58:31.565473',NULL,'+',11,'2023-08-14','ТО10000\r\nне исправен вентилятор 60376-1108 \r\nпроскальзывание тормозов осей 2,3,4,5,6',103,0),(36,75,'2023-08-14 08:58:31.727973',NULL,'~',11,'2023-08-14','ТО10000\r\nне исправен вентилятор 60376-1108 \r\nпроскальзывание тормозов осей 2,3,4,5,6',103,0),(15,76,'2023-09-25 09:41:38.908758',NULL,'-',11,'2023-02-28','Необходимо было оперативно провести первый запуск робота, инициализацию, замену платы NPN на PNP, установку платы Profinet и установки платы аналоговых IO. Все было успешно запущено, только при запуске было характерное трещание. Приняли решение, что это хруст внутреннего канала и при работе он перестанет шуметь.',99,0),(37,77,'2023-10-04 16:50:28.711839',NULL,'+',1,'2023-10-04','Монтаж линии',147,0),(37,78,'2023-10-04 16:50:29.005945',NULL,'~',1,'2023-10-04','Монтаж линии',147,0),(38,79,'2023-10-16 07:22:49.491794',NULL,'+',11,'2023-10-10','ТО10000 - без существенных нареканий',165,0),(38,80,'2023-10-16 07:22:50.408822',NULL,'~',11,'2023-10-10','ТО10000 - без существенных нареканий',165,0),(39,81,'2023-10-25 18:19:48.386432',NULL,'+',7,'2023-10-23','ТО с заменой смазки в роботе. При закачке JT1 выдавило сальник редуктора K104. Более подробное описание ситуации:\r\n\r\nКачали смазку в JT1. Смазка шла из порта drain, но меньше, чем закачивали. Обнаружили небольшие подтёки из под кожуха первой оси. Сняли его, там была течь смазки, практически всё тело сальника выдавлено. \r\n\r\n- Сальник при внешнем осмотре оказался не повреждённым, но после проверки и чистки находили черные ошмётки, предположительно могут быть его частью\r\n\r\n- Герметик, который был в узле, был не родной, т.к. этот редуктор уже менялся Орфером после того, как они выдавили тот же самый сальник\r\n\r\n- На лицо были следы разрушения этого самого герметика.\r\n\r\nМы все вытерли, заправили сальник на место. Он вошёл достаточно легко, что может говорить о том, что он уже просто растянут, и недостаточно плотно сидел. Проверили, выдавливает ли сальник при движении на скорости. Его не выдавливало.\r\n\r\nВажно: когда мы вычерпывали смазку, там была как свежая смазка, так и та, что там лежала некоторое время. Поэтому пришли к выводу, что сальник могло выдавить из-за расширения мультемпа и из-за того, что в прошлый раз накачали больше, чем нужно. Мы, по сути своей, просто дали малое давление на него, после чего он был довыдавлен',57,0),(39,82,'2023-10-25 18:19:48.693690',NULL,'~',7,'2023-10-23','ТО с заменой смазки в роботе. При закачке JT1 выдавило сальник редуктора K104. Более подробное описание ситуации:\r\n\r\nКачали смазку в JT1. Смазка шла из порта drain, но меньше, чем закачивали. Обнаружили небольшие подтёки из под кожуха первой оси. Сняли его, там была течь смазки, практически всё тело сальника выдавлено. \r\n\r\n- Сальник при внешнем осмотре оказался не повреждённым, но после проверки и чистки находили черные ошмётки, предположительно могут быть его частью\r\n\r\n- Герметик, который был в узле, был не родной, т.к. этот редуктор уже менялся Орфером после того, как они выдавили тот же самый сальник\r\n\r\n- На лицо были следы разрушения этого самого герметика.\r\n\r\nМы все вытерли, заправили сальник на место. Он вошёл достаточно легко, что может говорить о том, что он уже просто растянут, и недостаточно плотно сидел. Проверили, выдавливает ли сальник при движении на скорости. Его не выдавливало.\r\n\r\nВажно: когда мы вычерпывали смазку, там была как свежая смазка, так и та, что там лежала некоторое время. Поэтому пришли к выводу, что сальник могло выдавить из-за расширения мультемпа и из-за того, что в прошлый раз накачали больше, чем нужно. Мы, по сути своей, просто дали малое давление на него, после чего он был довыдавлен',57,0),(40,83,'2023-10-25 18:44:44.796784',NULL,'+',7,'2023-10-19','ТО с заменой смазки, батареек и сальника на JT6',32,0),(40,84,'2023-10-25 18:44:44.867893',NULL,'~',7,'2023-10-19','ТО с заменой смазки, батареек и сальника на JT6',32,0),(41,85,'2023-10-25 18:47:04.431