INSERT INTO `database_robotservice` VALUES (1,'2022-09-07','Восстановление серво софта на плате 1VA',3,0),(3,'2020-07-23','ТО 10000 часов',6,0),(4,'2022-09-13','Обнаружена неисправность модуля Power Unit',11,0),(5,'2020-11-26','Гарантийная замена подшипниковых узлов звена второй оси. Оплачивается КРГ. Работы выполнял Р. А. Цекин.',22,0),(6,'2020-11-25','Осмотр ТО5000',22,0),(7,'2022-10-13','1. Замена платы IO с NPN на PNP\r\n2. Замена китайской накладки на пульт на английскую',48,0),(8,'2022-07-07','Замена смазки\r\nРемонт захвата',19,0),(9,'2022-10-20','В соответствии с регламентом ТО 10000 произведены\r\n•	замена смазки редукторов всех осей\r\n•	замена батареек в руке\r\n•	внешний осмотр робота\r\n•	проверка наличия нехарактерных шумов\r\n•	проверка на наличие люфтов\r\n•	проверка срабатывания тормозов моторов\r\n•	проверка состояния кабелей\r\n•	натяжение ремня 6той оси\r\n\r\nЗамечания и контрмеры\r\n1.	Отработанная смазка осей JT2 имеет чёрный цвет и горелый запах, что говорит об интенсивной работе редуктора. \r\n	Действия не требуются. \r\n2.	Ремень 6той оси истерся и потерял требуемое натяжение.	\r\n        Ремень был натянут до требуемых параметров. Рекомендовано иметь запасной ремень на складе.\r\n\r\nИнженер Герасимов А.В.',49,0),(10,'2022-05-06','Обслуживание робота',52,0),(11,'2021-04-23','В соответствии с регламентом ТО 10000 произведены\r\n•	замена смазки редукторов всех осей\r\n•	замена батареек в руке и в контроллере робота\r\n•	внешний осмотр робота\r\n•	проверка наличия нехарактерных шумов\r\n•	проверка на наличие люфтов\r\n•	проверка срабатывания тормозов моторов\r\n•	проверка состояния кабелей',59,0),(12,'2022-12-07','ТО 10000. Прошло без нареканий. Состав: Филиппов М.А.; Ермин О.Е.',79,0),(13,'2022-12-07','Замена пружины jt3. Замена прошла без нареканий. Инженеры: Филиппов М.А.; Ермин О.Е.',80,0),(14,'2022-12-05','Замена энкодера на оси JT3',88,0),(16,'2023-03-01','Настройка Etherrnet IP',106,0),(17,'2023-03-01','Настройка Ethernet IP',7,0),(18,'2023-03-22','Базовое обслуживание робота. Была заменена смазка, проверены все узлы. Нареканий не обнаружено',117,0),(20,'2023-03-22','Базовое обслуживание робота. Была заменена смазка, проверены все узлы. Был выявлен надломленный кожух одного из двигателей JT1.',118,0),(21,'2023-03-27','ТО 10000',120,0),(22,'2023-04-05','Восстановление пульта. Были заменены все внутренности пульта, вернулась работоспособность',32,0),(23,'2023-04-04','Подключение и настройка сварочного источника EWM',121,0),(24,'2023-04-07','Замена прошивки на сварочную, подключение доп. оси и второй платы 1TW. Сейчас стоит две платы - NPN и PNP.',123,0),(26,'2023-04-07','Замена платы 1TW на PNP',96,0),(27,'2023-04-27','Подключение и настройка сварочного источника EWM',125,0),(28,'2023-05-17','ТО 10000.\r\nБез существенных отклонений.\r\nНе исправен вентилятор охлаждения контроллера, подтеки смазки сальника JT2',127,0),(29,'2023-05-17','ТО10000\r\nЗаменены балансиры JT2 (не оригинальные).\r\nЗаменен сервомотор JT2, так как не держал тормоз.\r\nПротечка сальника шестерни мотора JT2.',128,0),(30,'2023-07-18','В результате ТО 10000 обнаружен перекос балансира и разрушение редуктора оси JT5. Предложено заменить запястье целиком.',41,0),(31,'2023-07-17','ТО10000. без существенных замечаний',42,0),(32,'2023-07-21','Произведена замена узла запястья в сборе. после чего производилось переобучение ключевых точек программы.',41,0),(33,'2023-07-27','ТО 10000',19,0),(34,'2023-08-08','Гарантийный ремонт. Выскакивали ошибки E1500 и D1030. Проблему решила замена платы 1TB',139,0),(35,'2023-08-14','ТО10000\r\nна роботе имеется проблема с корректностью позиционирования при движении. вероятно проблема программного характера.\r\nТакже имеется проскальзывание тормозов осей 2,3,4,5,6.',102,0),(36,'2023-08-14','ТО10000\r\nне исправен вентилятор 60376-1108 \r\nпроскальзывание тормозов осей 2,3,4,5,6',103,0),(37,'2023-10-04','Монтаж линии',147,0),(38,'2023-10-10','ТО10000 - без существенных нареканий',165,0),(39,'2023-10-23','ТО с заменой смазки в роботе. При закачке JT1 выдавило сальник редуктора K104. Более подробное описание ситуации:\r\n\r\nКачали смазку в JT1. Смазка шла из порта drain, но меньше, чем закачивали. Обнаружили небольшие подтёки из под кожуха первой оси. Сняли его, там была течь смазки, практически всё тело сальника выдавлено. \r\n\r\n- Сальник при внешнем осмотре оказался не повреждённым, но после проверки и чистки находили черные ошмётки, предположительно могут быть его частью\r\n\r\n- Герметик, который был в узле, был не родной, т.к. этот редуктор уже менялся Орфером после того, как они выдавили тот же самый сальник\r\n\r\n- На лицо были следы разрушения этого самого герметика.\r\n\r\nМы все вытерли, заправили сальник на место. Он вошёл достаточно легко, что может говорить о том, что он уже просто растянут, и недостаточно плотно сидел. Проверили, выдавливает ли сальник при движении на скорости. Его не выдавливало.\r\n\r\nВажно: когда мы вычерпывали смазку, там была как свежая смазка, так и та, что там лежала некоторое время. Поэтому пришли к выводу, что сальник могло выдавить из-за расширения мультемпа и из-за того, что в прошлый раз накачали больше, чем нужно. Мы, по сути своей, просто дали малое давление на него, после чего он был довыдавлен',57,0),(40,'2023-10-19','ТО с заменой смазки, батареек и сальника на JT6',32,0),(41,'2023-10-19','ТО с заменой смазки и батареек. Была проба заменить программу PC_PALLETS на модифицированную, что не увенчалось успехом, т.к. нужна дополнительная модификация программы на PLC',33,0),(42,'2023-11-09','ТО 10000',175,0),(43,'2023-11-09','ТО 10000',176,0),(44,'2023-11-09','ТО 10000',177,0),(45,'2023-12-04','Модернизация планировки линии',168,0),(46,'2023-12-04','Модернизация планировки линии',169,0),(47,'2024-01-24','ТО10000  (24.01.2024)\r\nбез отклонений',197,0),(48,'2024-02-09','ТО10000\r\n+\r\nМодификация ПО',1,0),(49,'2024-02-08','Описание:\r\nТО10000\r\n+\r\nМодификация ПО',2,0),(50,'2024-02-19','ТО 10000\r\n\r\nВ процессе выявлена протечка на подшипнике jt3, перегрузка jt1 и подклинивание вентилятора 4 в контроллере',192,0),(52,'2024-02-16','ТО 10000. Робот в прекрасном состоянии.',205,0),(53,'2024-03-06','Предан в аренду в РКР по договору №2403-2 от 05.03.2024 Спецификация№1 (на выставку)',208,0),(54,'2024-03-14','На роботе возникла проблема с позиционированием. Причина в поврежденном ремне JT6 - произведена замена.\r\nПроведено ТО10000 согласно регламенту.',49,0),(55,'2024-03-20','ТО10000 согласно регламенту',79,0),(56,'2024-03-22','Возникла проблема с позиционированием при захвате роботом картонного диска. Один диск относительного второго захватывались с большим смещением. Проблемы с роботом не выявлено,',42,0),(57,'2024-04-03','Ремонт порванного кабеля 6 оси',211,0),(58,'2024-04-05','ПНР робота с комплексом КГША-1300',85,0),(59,'2024-04-19','Плановое ТО',219,0),(60,'2024-04-19','Плановое ТО',220,0),(61,'2024-04-19','Плановое ТО',221,0),(62,'2024-04-18','Плановое ТО',222,0),(63,'2024-04-18','Плановое ТО',223,0),(64,'2024-05-06','Описание:\r\nВ соответствии с регламентом ТО 10000 произведены\r\n• замена смазки редукторов всех осей\r\n• замена батареек в руке и в контроллере робота\r\n• внешний осмотр робота\r\n• проверка наличия нехарактерных шумов\r\n• проверка на наличие люфтов\r\n• проверка срабатывания тормозов моторов\r\n• проверка состояния кабелей',59,0),(65,'2024-05-06','В соответствии с регламентом ТО 10000 произведены\r\n• замена смазки редукторов всех осей\r\n• замена батареек в руке и в контроллере робота\r\n• внешний осмотр робота\r\n• проверка наличия нехарактерных шумов\r\n• проверка на наличие люфтов\r\n• проверка срабатывания тормозов моторов\r\n• проверка состояния кабелей',150,0),(66,'2024-05-04','В соответствии с регламентом ТО 10000 произведены\r\n• замена смазки редукторов всех осей\r\n• замена батареек в руке и в контроллере робота\r\n• внешний осмотр робота\r\n• проверка наличия нехарактерных шумов\r\n• проверка на наличие люфтов\r\n• проверка срабатывания тормозов моторов\r\n• проверка состояния кабелей\r\n• проверка состояния балансиров',225,0),(67,'2024-05-21','Проведена диагностика, связанная с подозрением на люфты в осях JT1, 5, 6.\r\nлюфтов не обнаружено. Присутствуют звуки трогания моторов в соответствующих осях. Действий не требуется.',138,0),(68,'2024-07-03','Смена прошивки с Handling на Arc Welding',216,0),(69,'2024-09-24','ТО 10000. Замена смазки, батарейки. В следующий раз нужно подкачать газовые пружины',19,0);
